import React from 'react';
import './projects.css';
import logo from './logo.png';

const Projects = () => {
    const githubUrls = [
        'https://github.com/your-username/project1',
        'https://github.com/your-username/project2',
        'https://github.com/your-username/project3'
    ];

    return (
        <div className="container">
            <div className="text-container">
                <h2>Connect X</h2>
                <p className="text">Description of project 1.</p>
            </div>
            <div className="image-container">
                <img className="image" src= {logo} alt="logo"/>
            </div>
            <div className="text-container">
                <h2>Wordl Solver+</h2>
                <p className="text">Description of project 2.</p>
            </div>
            <div className="image-container">
                <img className="image" src="logo192.png" alt="Project 2" />
            </div>
            <div className="text-container">
                <h2>Cypher Code</h2>
                <p className="text">Description of project 3.</p>
            </div>
            <div className="image-container">
                <img className="image" src="logo512.png" alt="Project 3" />
            </div>
        </div>
    );
};

export default Projects;
